iries.  \r\n\r\n◆◆◆For inquiries about technical issues/operation of the online response system◆◆◆\r\nIf you have any questions, please contact Cbase Corporation.\r\nE-mail: 360_support@cbase.co.jp\r\n\r\n◆◆◆For general inquiries about 360-degree Feedback 2011◆◆◆\r\nHuman Resources Development, **** Japan Inc.,	\N	\N	\N	\N	\N	\N	4		\N	\N	\N
