385	user_relation_view_message_2	ユーザ	回答者情報閲覧	文言	承認者の選択　説明文	上司へ回答者承認依頼メールを送ってください。\n\n<!--承認者を検索 -> 承認者選択 -> 承認依頼メールを送信　という流れになります。\n回答者の追加や変更がある場合は、「回答者の追加 / 変更」ボタンを押して、指名を続けて下さい。\n回答者を指名したら、下の「回答者を確定する」ボタンを押して回答者の指名を完了して下さい。 -->	Your rater list is subject to approval by your direct boss. Please send email to request for approval.\n\n<!--If you'd like to select more raters, please click "Add / Edit" button.\n\nAfter you selected, please click "Confirm Raters" button.-->	如果要增加或變更回答人，請按【回答人的增加/變更】按鈕，繼續選擇。\n\n選擇好全部回答人後，請按下以下按鈕，發送回答人批准請求郵件。\n\n流程為：檢索批准人 -> 選擇批准人 -> 發送批准請求郵件。	发送批准请求邮件。\n\n<!--如果要增加或变更回答人，请按【回答人的增加/变更】按钮，继续选择。\n\n选择好全部回答人后，请按下以下按钮，发送回答人批准请求邮件。-->	응답자를 추가하거나 변경할 경우에는 【응답자 추가/변경】버튼을 눌러 선정을 계속하십시오.\n\n응답자를 모두 선정했으면 아래 버튼을 눌러 응답자 승인 의뢰 메일을 보내십시오. \n\n승인자를 검색->승인자 선택->승인 의뢰 메일 송신, 이 순서로 하시면 됩니다.	
248	mypage_infomation	ユーザ	マイページ	お知らせ	マイページのお知らせ	<b>◆概要</b>\r\n本サーベイは、対象者の周囲からその人の強みや発揮している能力を指摘してもらい対象者にフィードバックすることで、\r\n対象者の今後の課題を明らかにし、リーダーとしてより一層活躍して頂くことを目的としています。\r\n対象者・ご協力者共に、昇進や昇給には影響致しません。\r\n皆様の率直なご意見が対象者の成長に生かされますので、是非ご協力のほどお願い致します。\r\n\r\n<b>◆情報の取扱いについて</b>\r\nご記入頂きましたご回答内容はフィードバック研修を通じて対象者へ返却致します。\r\nその際に回答内容が個人として特定されることはありません。\r\nまた、個人情報やご回答内容はあくまでも調査のためのものであり、\r\nこれらの情報を第三者に提供・開示することやその目的以外で使用することはありません。\r\n\r\n<b>◆回答期間</b>\r\n0000年00月00日（）～00月00日（）00：00\r\n※土日も含め24時間アクセス可能です。\r\n\r\n◆◆◆サーベイの内容に関するお問合せ先◆◆◆\r\n株式会社XXXXXX\r\n担当：XXXXXX　　電話：03-XXXX-XXXX　　メール：<a href="mailto:XXXX@cbase.co.jp">XXXX@cbase.co.jp</a>	<b>Overview:</b>\r\nThe 360 degree feedback survey is conducted to assess the ratee's performance for identifying improvement areas and strengths.\r\nThe result won't be used to revise the salary.\r\nYour candid feedback is highly appreciated.\r\n\r\n<b>Confidentiality:</b>\r\nThe answered feedbacks are communicated to the ratee through the feedback session.\r\nNo raters will be identified in the reports and any information that may disclose the rater's identity will be also masked accordingly.\r\n\r\n<b>Review period:</b>\r\nJan 1 (Monday) – Dec 31 (Friday) 23:59 (Japan Time)\r\n*The system is open 24 hours including weekend during the above period\r\n\r\nIf you have any questions regarding writing the feedback, please contact:\r\n360 Survey Team\r\nXXXX Inc. \r\n<a href="mailto:XXX@cbase.co.jp">XXX@cbase.co.jp</a>\r\n03-XXXX-XXXX	本体（繁体字)お知らせ	本次调查将把大家对调查对象的日常感受进行统计汇总，使之成为有助于改善职场环境的资料。\r\n对各项提问，请如实回答自己的想法。\r\n\r\n请遵从画面说明回答问题。	本体（韓国語)お知らせ	
